First Lady N. Johnson has a real passion to inspire, encourage, empower and motivate people. Her heart for international development and orphan-care has been ignited by her passion for orphan ministry, which she first discovered through her work in South Africa and subsequently in Cambodia.

Food for thought:

Procrastination is a killer of dreams, a robber of joy, a murderer of purpose, and can cause a life of missed opportunities. Be wise with your life and who you choose to spend your time with.
